var title_f25_33_26140="Thrombolytic regimens STEMI";
var content_f25_33_26140=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F56744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F56744&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Preferred thrombolytic regimens for acute ST elevation myocardial infarction",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Drug",
"       </td>",
"       <td class=\"subtitle1\">",
"        Recommended IV regimen*",
"       </td>",
"       <td class=\"subtitle1\">",
"        Advantages and limitations",
"       </td>",
"      </tr>",
"      <tr>",
"       <td rowspan=\"3\">",
"        Alteplase (accelerated regimen)",
"       </td>",
"       <td>",
"        15 mg bolus",
"       </td>",
"       <td rowspan=\"3\">",
"        Better outcomes than streptokinase in GUSTO-1 (30-day mortality 6.3 versus 7.3 percent); costlier than streptokinase; more difficult to administer because of short half-life",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         then",
"        </strong>",
"        0.75 mg/kg (maximum 50 mg) over 30 minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         then",
"        </strong>",
"        0.5 mg/kg (maximum 35 mg) over the next 60 minutes",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td rowspan=\"6\">",
"        Tenecteplase",
"       </td>",
"       <td>",
"        Single bolus over five to ten seconds based upon body weight:",
"       </td>",
"       <td rowspan=\"6\">",
"        As effective as alteplase in ASSENT-2 with less noncerebral bleeding and need for transfusion; easier to administer (single bolus due to longer half-life) both in and out of hospital; these advantages make tenecteplase the drug of choice in many US hospitals",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &lt;60 kg: 30 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        60 to 69 kg: 35 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        70 to 79 kg: 40 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        80 to 89 kg: 45 mg",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        &ge;90 kg: 50 mg",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Reteplase",
"       </td>",
"       <td>",
"        10 units over two minutes then repeat 10 unit bolus at 30 minutes",
"       </td>",
"       <td>",
"        Similar outcomes as alteplase but easier to administer",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        Streptokinase",
"       </td>",
"       <td>",
"        1.5 million units over 30 to 60 minutes",
"       </td>",
"       <td>",
"        Generally a much less costly option than other fibrinolytics but outcomes are inferior. Neutralizing antibodies develop, which can diminish efficacy of subsequent use. Elevated risk of hypersensitivity reaction with repeated doses. Used extensively outside North America due to lower cost. (Not available in US or CAN).",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * All patients are also given non enteric-coated aspirin 162 to 325 mg and, with alteplase, reteplase, and tenecteplase, unfractionated heparin as a 60 units/kg bolus (maximum 4000 units) followed by an intravenous infusion of 12 units/kg per hour (maximum 1000 units per hour) adjusted to target aPTT of 50 to 70 seconds. Heparin has not been definitively shown to improve outcomes with non-fibrin-specific agents such as streptokinase. However, heparin is recommended with streptokinase in patients who are at high risk for systemic thromboembolism (large or anterior myocardial infarction, atrial fibrillation, previous embolus, or known left ventricular thrombus).",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
